import React from "react";
import ReactDOM from "react-dom";
import {BrowserRouter as Link,Switch,Router,Route} from "react-router-dom";

import App from "./App";
import navbar from "./components/navbar";
// import "./index.css";


ReactDOM.render(
    <Router>
    <div>
      <Route exact path="/">
        <navbar />
      </Route>
    </div>
  </Router>,
    document.getElementById("root")
);
